import React from 'react';
import { Pie } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

//gets the unique countries in the object
const getUnqiue = (object, key) => {
  const allElements = object.map(x => x[key]);
  const unqiueElements = ([... new Set(allElements)]);
  return unqiueElements;
}

//gets how many times those unique elements show up in the object 
const getValues = (array) =>{
  console.log("array= " + array)

  // let values = [];
  // array.forEach(element => values.push(element));

  // console.log(values);

  return array.filter((v) => (v === 'Japan')).length;

  // return values;
}

const Types = (props) => {

  const labels = getUnqiue(props.beer, 'country');

  console.log(getValues(labels));

  const data = [11, 11, 11, 11];
  const colors = [
    "red",
    "blue",
    "yellow",
    "green",
    "brown",
  ];

  const asdf = {
    dataPie: {
      labels: labels,
      datasets: [
        {
          data: data,
          backgroundColor: colors,
          hoverBackgroundColor: colors
        }
      ]
    }
  }

  return (
    <MDBContainer>
      <h3>Country of Origin</h3>
      <Pie data={asdf.dataPie} options={{ responsive: true }} />
    </MDBContainer>
  )
}

export default (Types);
